  const [access, setAccess] = useState(null);
  const [user, setUser] = useState(null)

  useEffect(() => {
    setAccess(accessToken)

    const getUserData = async () => {
      const response = await getUser();
      setUser(response.data)
      console.log(response.data)
    }
    getUserData();
  },[])


  return (
    <>
      <Header /> 
        <Grid />
    </>
  );
};

export default Home;
